import React from 'react';
import { Link } from 'react-router-dom';
import "../Components/styles/P"

function PythonCourse() {
  return (
    <div className="course-details">
      <h1>Python Course</h1>
      <p>
        Python is a popular programming language known for its simplicity and readability.
        It is widely used in various fields including web development, data science, and more.
      </p>
      <div className="course-photos">
        <img src="/path/to/python-image1.jpg" alt="Python Example 1" />
        <img src="/path/to/python-image2.jpg" alt="Python Example 2" />
        {/* Add more images as needed */}
      </div>
      <Link to="/" className="back-link">Back to Courses</Link>
    </div>
  );
}

export default PythonCourse;
